import React from 'react';
import {recs} from './Reccomendations'

class Results extends React.Component {
    render(){
        const round ={color:'black',padding:'5px',background:'#73AD21',borderRadius:'25px'}
        console.log(recs[0])

        return(
            <div className="list-group">
                {/* <a href="#" className="list-group-item list-group-item-action" style={{font:'small-caption'}} >Your Results!!!</a> */}
                <h1 style={{color:'white',paddingLeft:'15px'}}>Your Results</h1>
                <br></br>

                <a style={{color:'black'}} href="#" className="list-group-item list-group-item-action list-group-item-primary" style={round}></a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-secondary" style={round}>W</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-success" style={round}>T</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-danger" style={round}>T</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-warning" style={round}>T</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-info" style={round}>Th</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-light" style={round}>T</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-dark" style={round}>T</a>
            </div>

            );

        }

    }

export default Results;
